descriptionObj.\\class:
            non-standard; extension is loaded automatically when used;<br>
            used to specify a CSS class for styling mathematics<br>
            <div class="syntax">\class #1 #2</div>
            where:
            <ul>
                <li><code>#1</code>&nbsp; is a CSS class name (without quotes)</li>
                <li><code>#2</code>&nbsp; is the mathematics to be styled</li>
            </ul>
            Example:<br>
            Suppose this CSS style information is provided outside of math mode:
            <!-- here's the style information -->
            <style type="text/css">

                .smHighlightRed {
                    font-size: small;
                    background-color: yellow;
                    color: red;
                }
            </style>
            <!-- end of style information -->
<pre>&lt;style type="text/css"&gt;
.smHighlightRed {
font-size:small;
background-color:yellow;
color:red;
}
&lt;/style&gt;
</pre>
            Then,
            <table class="exampleTable">
                <tbody><tr>
                    <td><code>ab\class{smHighlightRed}{cdef}gh</code></td>
                    <td>yields</td>
                    <td style="width:200px;">$ab\class{smHighlightRed}{cdef}gh$</td>
                </tr>
            </tbody></table><br>

descriptionObj.\\newenvironment:
            for defining your own <a href="#environments">environments</a>;<br>
            <code>\newenvironment</code>&nbsp; must appear (within math delimiters) before it is used
            <div class="syntax" style="text-align:left;">
<pre>\newenvironment{myEnvironmentName}
[ &lt;optional # of arguments, from 1 to 9&gt; ]
{ &lt;replacement text for each occurrence of \begin{myEnvironmentName}&gt; }
{ &lt;replacement text for each occurrence of \end{myEnvironmentName}&gt; }
</pre>
            </div>
            The bracketed # of arguments is omitted when there are no arguments.<br>
            There must not be a command having the same name as the environment:<br>
            for example, to use &nbsp; <code>\begin{myHeart}...\end{myHeart}</code> &nbsp; there may not be a command <code>\myHeart</code>.<br>
            <br>
            Example (no arguments):<br>
<pre>\newenvironment{myHeartEnv}
{\color{purple}{\heartsuit}\kern-2.5pt\color{green}{\heartsuit}}
{\text{ forever}}

\begin{myHeartEnv}
\end{myHeartEnv}
</pre>
            yields:
            $
            \newenvironment{myHeartEnv}
            {\color{purple}{\heartsuit}\kern-2.5pt\color{green}{\heartsuit}}
            {\text{ forever}}

            \begin{myHeartEnv}
            \end{myHeartEnv}
            $<br>
            <br>
            An environment may take one or more arguments:<br>
            <br>
            Example (two arguments):
<pre>\newenvironment{myHeartEnv}[2]
{\color{#1}{\heartsuit}\kern-2.5pt\color{#2}{\heartsuit}}
{\text{ forever}}

\begin{myHeartEnv}{red}{blue}
\end{myHeartEnv}
</pre>
            yields:
            $
            \newenvironment{myHeartEnv}[2]
            {\color{#1}{\heartsuit}\kern-2.5pt\color{#2}{\heartsuit}}
            {\text{ forever}}

            \begin{myHeartEnv}{red}{blue}
            \end{myHeartEnv}
            $<br>
            <br>
            see also: &nbsp; <a href="#def">\def</a>,
            &nbsp; <a href="#newcommand">\newcommand</a>

descriptionObj.\\strut:
            an invisible box with no width, height 8.6pt and depth 3pt;<br>
            note that &nbsp; <code>\mathstrut</code> &nbsp; changes with the current size, but
            &nbsp; <code>\strut</code> &nbsp; does not<br>
            <br>
            Examples:<br>
            <table class="exampleTable">
                <tbody><tr>
                    <td>
<pre>\sqrt{(\ )}
\sqrt{\mathstrut\rm mathstrut}
\sqrt{\strut\rm strut}
</pre>
                    </td>
                    <td>yields</td>
                    <td>
                        $
                        \sqrt{(\ )}
                        \sqrt{\mathstrut\rm mathstrut}
                        \sqrt{\strut\rm strut}
                        $
                    </td>
                </tr>
                <tr>
                    <td>
<pre>\Tiny
\sqrt{(\ )}
\sqrt{\mathstrut\rm mathstrut}
\sqrt{\strut\rm strut}
</pre>
                    </td>
                    <td>yields</td>
                    <td>
                        $
                        \Tiny
                        \sqrt{(\ )}
                        \sqrt{\mathstrut\rm mathstrut}
                        \sqrt{\strut\rm strut}
                        $
                    </td>
                </tr>
                <tr>
                    <td>
<pre>\Large
\sqrt{(\ )}
\sqrt{\mathstrut\rm mathstrut}
\sqrt{\strut\rm strut}
</pre>
                    </td>
                    <td>yields</td>
                    <td>
                        $
                        \Large
                        \sqrt{(\ )}
                        \sqrt{\mathstrut\rm mathstrut}
                        \sqrt{\strut\rm strut}
                        $
                    </td>
                </tr>
            </tbody></table>
            see also: &nbsp; <a href="#mathstrut">\mathstrut</a>

descriptionObj.\\substack:
            use for multi-line subscripts or superscripts<br>
            <br>
            Examples:<br>
            <table class="exampleTable">
                <tbody><tr>
                    <td>
<pre>\sum_{
\substack{
1\lt i\lt 3 \\
1\le j\lt 5
}}
a_{ij}
</pre>
                    </td>
                    <td>yields (display mode)</td>
                    <td>
                        $$\sum_{
                        \substack{
                        1\lt i\lt 3 \\
                        1\le j\lt 5
                        }}
                        a_{ij}
                        $$
                    </td>
                </tr>
                <tr>
                    <td>
<pre>^{\substack{\text{a very} \\
\text{contrived} \\
\text{example}
}}
{\frac ab}_{\substack{
\text{isn't} \\
\text{it?}
}}
</pre>
                    </td>
                    <td>yields (display mode)</td>
                    <td>
                        $$
                        ^{\substack{\text{a very} \\
                        \text{contrived} \\
                        \text{example}
                        }}
                        {\frac ab}_{\substack{
                        \text{isn't} \\
                        \text{it?}
                        }}
                        $$
                    </td>
                </tr>
            </tbody></table>
            <br>
            see also: &nbsp; <a href="#subarray">\begin{subarray}</a>
